import React from "react";

import "../pageTransitions/slideTransition.scss";
import { TransitionGroup, CSSTransition } from "react-transition-group";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function Home() {
  const timeout = { enter: 800, exit: 400 };
  return (
    <TransitionGroup>
      <CSSTransition
          // key={currentKey}
          timeout={timeout}
          classNames="pageSlider"
          mountOnEnter={false}
          unmountOnExit={true}
        ></CSSTransition>
    <>
      <script
        src="https://cdnjs.cloudflare.com/ajax/libs/barba.js/1.0.0/barba.min.js"
        integrity="sha512-7b1FfB2MGnB65aK6jrbS8k3REB+8bEE8UfP/TEwacejD0g02nLLI1VL4IPcKyiLk2lf7HJWaUYEUWc65aqaXQg=="
        crossorigin="anonymous"
      ></script>
      <div className="homepage">
        <div className="intro">
          <h1 className="firstPageDivs">Pierce Butler</h1>
          <h1 className="firstPageDivs">Software Engineer</h1>
          <h1 className="firstPageDivs">Front-end Enthusiast</h1>
        </div>
            <div className="links">
              <Link to="/aboutme" className="firstPageDivs">
                About Me
              </Link>
              <Link to="/portfolio" className="firstPageDivs">
                Portfolio
              </Link>
              <Link to="/contact" className="firstPageDivs">
                Contact me
              </Link>
            </div>
      </div>
      </>
      </TransitionGroup>
  );
}

export default Home;
